<p>CT KIDNEY DATASET: Normal-Cyst-Tumor and Stone</p>
<h3>Content</h3>
<p>The dataset was collected from PACS (Picture archiving and 
communication system) from different hospitals in Dhaka, Bangladesh 
where patients were already diagnosed with having a kidney tumor, cyst, 
normal or stone findings. Both the Coronal and Axial cuts were selected 
from both contrast and non-contrast studies with protocol for the whole 
abdomen and urogram. The Dicom study was then carefully selected, one 
diagnosis at a time, and from those we created a batch of Dicom images 
of the region of interest for each radiological finding. Following that,
 we excluded each patient's information and meta data from the Dicom 
images and converted the Dicom images to a lossless jpg image format. 
After the conversion, each image finding was again verified by a 
radiologist and a medical technologist to reconfirm the correctness of 
the data. </p>
<p>Our created dataset contains 12,446 unique data within it in which 
the cyst contains 3,709, normal 5,077, stone 1,377, and tumor 2,283</p>
<p>Kindly Cite if you are finding this helpful-</p>
<p>Islam MN, Hasan M, Hossain M, Alam M, Rabiul G, Uddin MZ, Soylu A. 
Vision transformer and explainable transfer learning models for auto 
detection of kidney cyst, stone and tumor from CT-radiography. 
Scientific Reports. 2022 Jul 6;12(1):1-4.</p>
